INSERT INTO `jobs` VALUES (43,'Medical Doctor','Debremarkos',2000,'$','Evaluate a patient‚Äôs symptoms and determine the most appropriate course of treatment to address them.\r\nPrescribe medications in compliance with state and federal statutes and inform patients of all possible risks.\r\ncomplications and interference with other medications they may be taking.\r\nSupervise and evaluate Medical Assistants to ensure full compliance with regulations and make sure that the current care program is as effective as possible..\r\nConsult patients on topics such as proper nutrition, fitness and hygiene to assist them in making informed decisions and taking good care of their health','A doctorate medical degree from an accredited school\r\nBe certified by the medical board, have state license, and a Federal DEA license\r\nHave completed a residency\r\nExperience working in the medical field, preferably in position that required the demonstration of leadership skills\r\nThe ability to work well under pressure, in a complex, fast-paced environment, and strong decision making skills\r\nFlexible schedule that allows for long shifts and periods of on-call service\r\nStrong written and verbal communication skills\r\nStrong data analysis and evaluation skills','2024-07-18','2024-07-23'),(44,'Software Engineer','Ethiopia, Addis Ababa',1000,'dollar','Execute full software development life cycle (SDLC)\r\nDevelop flowcharts, layouts and documentation to identify requirements and solutions\r\nWrite well-designed, testable code\r\nProduce specifications and determine operational feasibility\r\nIntegrate software components into a fully functional software system\r\nDevelop software verification plans and quality assurance procedures\r\nDocument and maintain software functionality\r\nTroubleshoot, debug and upgrade existing systems\r\nDeploy programs and evaluate user feedback\r\nComply with project plans and industry standards\r\nEnsure software is updated with latest features','Proven work experience as a Software Engineer or Software Developer\r\nExperience designing interactive applications\r\nAbility to develop software in Java, Ruby on Rails, C++ or other programming languages\r\nExcellent knowledge of relational databases, SQL and ORM technologies (JPA2, Hibernate)\r\nExperience developing web applications using at least one popular web framework (JSF, Wicket, GWT, Spring MVC)\r\nExperience with test-driven development\r\nProficiency in software engineering tools\r\nAbility to document requirements and specifications\r\nBSc degree in Computer Science, Engineering or relevant field','2024-06-19','2024-06-27'),(49,'technicial','debremarkos',1500,'$','managing lab class\r\nsoftware instalation','bsc degree\r\n3years experians\r\nmsc degree','2024-08-24','2024-08-31'),(50,'cafteria cashier','debremarkos',30000,'br','accepting cassh mony\r\ntreatin customer','collect money\r\nwilling to relocate','2024-08-23','2024-08-31');
